/*Table structure for table `salida_material` */

DROP TABLE IF EXISTS `salida_material`;

CREATE TABLE `salida_material` (
  `id_salida_material` int(11) NOT NULL AUTO_INCREMENT,
  `id_socio` int(11) DEFAULT NULL,
  `id_pedido` int(11) DEFAULT NULL,
  `fecha` date DEFAULT NULL,
  `estado` varchar(10) DEFAULT 'activo',
  PRIMARY KEY (`id_salida_material`),
  KEY `pedido_salida` (`id_pedido`),
  KEY `socio_salida` (`id_socio`),
  CONSTRAINT `pedido_salida` FOREIGN KEY (`id_pedido`) REFERENCES `pedido` (`id_pedido`),
  CONSTRAINT `socio_salida` FOREIGN KEY (`id_socio`) REFERENCES `socio` (`id_socio`)
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=latin1;

